import React from 'react';
import {Button, createTheme, MuiThemeProvider} from "@material-ui/core";
import RadioConfigGroup from "./components/RadioConfigGroup";
import {RadioType} from "./objects/enums/RadioType";

const theme = createTheme({
    typography:{
        fontFamily: ['Roboto','sans-serif'].join(',')
    },
    palette: {
        primary: {main: '#420088'}, // Purple and green play nicely together.
        secondary: {main: '#124800'}, // This is just green.A700 as hex.
    },

});

function App() {
    return (
        <MuiThemeProvider theme={theme}>
            <div className="App">
                <header className="header">
                    <h1 className="title">Projekt ZTBD - Kamil Kubala, Maciej Sp√≥lnik</h1>
                </header>
                <div className="container card">
                    <div className="radios">
                        <RadioConfigGroup radioType={RadioType.OPERATION}/>
                        <RadioConfigGroup radioType={RadioType.TYPE}/>
                        <RadioConfigGroup radioType={RadioType.QUANTITY}/>
                    </div>
                    <Button variant={"contained"} color={"primary"} className="button" >Wykonaj</Button>
                    <h2 className="result">Wynik</h2>
                    <div className="resultCard card">
                        <text className="resultTitle">PostgreSQL</text>
                    </div>
                    <div style={{height: '3vh'}}/>
                    <div className="resultCard card"></div>
                </div>

            </div>
        </MuiThemeProvider>
    );
}

export default App;
